import React, { useEffect, useState } from "react";
import { Row, Col, Container, Card, Button } from "react-bootstrap";

const DateTimeElem = (props) => {

    const [disabled, setDisabled] = useState(false); 

    const handleClick = () => {
        sessionStorage.setItem("date", props.date);
        // props.func(3);
    }

    useEffect(() => {
        if (props.busy.filter((elem) =>{ 
            elem.setMilliseconds(0);
            props.date.setMilliseconds(0);
            console.log(elem.getTime() + ' ' + props.date.getTime());
            return (elem.getTime() === props.date.getTime())}).length != 0
        ) {
            setDisabled(true);
        }
        if (props.date.getTime() < (new Date()).getTime()) {
            setDisabled(true);
        }
    
    })


    return (
        <Col md = {3} className="mb-4">
        <Card className = "h-100">
            <Card.Body disabled>
                <Card.Text onClick={() => handleClick()}>{props.date.getHours() + ":" + ((props.date.getMinutes() < 10) ? '0' : "") + props.date.getMinutes()}</Card.Text>
            </Card.Body>
        </Card>
        </Col>
    )

}

export default DateTimeElem;
